import React, { Component } from 'react';

class Results extends Component {
   state = {
      testResults: []
   }

   componentDidMount() {
      this.setState({
         testResults: this.props.testResults
      });
   };

   render() {
      console.log(this.state.testResults.ear[0].hertz[3].hzLevel);
      return (
         <main>
            <p className="ml-4">Results</p>
         </main>
      );
   }
}

export default Results;
